site.headStyle:
.logo-text {
    font-family: 'Lato';
    font-style: normal;
    font-weight: 700;
    font-size: 36px;
    line-height: 43px;

    color: #302F2F;

}
.nav-menu-blue {
    font-family: 'Lato';
    font-style: normal;
    font-weight: 700;
    font-size: 18px;
    line-height: 22px;
    /* identical to box height */


    color: #01579B;

    mix-blend-mode: normal;
    opacity: 0.75;
}
.nav-bottom-border {
    border-radius: 3px;
}
.nav-menu-gray {
    font-family: 'Lato';
    font-style: normal;
    font-weight: 700;
    font-size: 18px;
    line-height: 22px;
    /* identical to box height */


    color: #585858;

    mix-blend-mode: normal;
    opacity: 0.75;
}
.login-link {
    font-family: 'Lato';
    font-style: normal;
    font-weight: 700;
    font-size: 16px;
    line-height: 19px;
    text-transform: uppercase;

    color: #302F2F;
}
.register-button {
    border-radius: 19.5px;
}
.register-button-text {
    font-family: 'Lato';
    font-style: normal;
    font-weight: 700;
    font-size: 16px;
    line-height: 19px;
    text-align: center;
    text-transform: uppercase;

    color: #FFFFFF;
}
.search-button {
    border: 2px solid #4CAF50;
    border-radius: 19.5px;  
}
.search-button-text {
    font-family: 'Lato';
    font-style: normal;
    font-weight: 700;
    font-size: 16px;
    line-height: 19px;
    
    color: #4CAF50;
}
.section-one-title {
    font-family: 'Lato';
    font-style: normal;
    font-weight: 700;
    font-size: 48px;
    line-height: 58px;
    color: #302F2F;
}
.section-one-text {
    font-family: 'Lato';
    font-style: normal;
    font-weight: 400;
    font-size: 32px;
    line-height: 48px;
    /* or 150% */


    color: rgba(0, 0, 0, 0.54);
}
.more-info-text {
    font-family: 'Lato';
    font-style: normal;
    font-weight: 700;
    font-size: 24px;
    line-height: 29px;
    /* identical to box height */

    text-transform: uppercase;

    color: #357A38;
}
.register-now-button {
    border-radius: 24px;
}
