}
.our-speciality-cards {
    border: 1px solid rgba(0, 0, 0, 0.12);
    border-radius: 15px;
}
.our-speciality-cards-blue {
    border-radius: 15.5px;
}
.our-speciality-cards-blue-text {
    font-family: 'Lato';
    font-style: normal;
    font-weight: 400;
    font-size: 14px;
