    color: #FFFFFF;
}
.our-speciality-cards-text {
    font-family: 'Lato';
    font-style: normal;
    font-weight: 400;
    font-size: 14px;
    line-height: 17px;
    /* identical to box height */

    text-align: center;

    color: rgba(0, 0, 0, 0.54);
}
.job-card {
  box-shadow: 10px 40px 50px rgba(229, 233, 246, 0.4);
  border-radius: 20px;
}
.job-card-title {
  font-family: 'Open Sans';
  font-style: normal;
  font-weight: 700;
  font-size: 24px;
  line-height: 150%;
  /* identical to box height, or 36px */


  /* gray/900 */

  color: #18181B;
}
.job-card-rate {
  font-family: 'Amazon Ember';
  font-style: normal;
  font-weight: 400;
  font-size: 24px;
  line-height: 24px;
  /* identical to box height, or 100% */

  letter-spacing: -0.5px;

  color: #3F3F46;
}
.job-card-tags {
  font-family: 'Amazon Ember';
  font-style: normal;
  font-weight: 400;
  font-size: 16px;
  line-height: 150%;
  /* identical to box height, or 24px */


  /* gray/700 */

  color: #3F3F46;
}
.job-card-skill-card {
  border-radius: 7px;
}
.job-card-skill-card-text {
  font-family: 'Amazon Ember';
  font-style: normal;
  font-weight: 400;
  font-size: 14px;
  line-height: 22px;
  /* identical to box height, or 160% */


  color: #1F1F1F;
}
.ask-doctors-text {
    font-family: 'Lato';
    font-style: normal;
    font-weight: 900;
    font-size: 52px;
    line-height: 78px;
    /* or 150% */


    color: rgba(0, 0, 0, 0.87);
}
.ask-doctors-cards {
    box-shadow: 0px 4px 27px rgba(172, 172, 172, 0.25);
    border-radius: 6px; 
}
.ask-doctors-cards-names {
    font-family: 'Lato';
    font-style: normal;
    font-weight: 700;
    font-size: 24px;
    line-height: 150%;
    /* or 36px */


    /* gray/900 */

    color: #18181B;
}
.ask-doctors-cards-title {
    font-family: 'Lato';
    font-style: normal;
    font-weight: 400;
    font-size: 24px;
    line-height: 150%;
    /* or 36px */


    color: #757575;
}
